import { Box, Heading, Text } from '@primer/react'

export function SelectHeader() {
    return (
        <Box>
            <Heading
                as="h1"
                sx={{
                    fontSize: '4',
                }}
            >
                All Usage
            </Heading>
            <Text
                sx={{
                    color: 'fg.muted',
                    fontSize: '1',
                }}
            >
                Includes amounts spent for organizations and repositories across
                all services.{' '}
                <Text
                    as="span"
                    sx={{
                        color: 'accent.fg',
                    }}
                >
                    View current and past pricing information.
                </Text>
            </Text>
        </Box>
    )
}
